import React, { useContext, useState } from "react"
import { Btn } from "../utils"
import { sendRequest } from "../utils/Api";
import { Req } from "../interfaces";
import { Auth } from "../context/Auth";
export const Register = () => {
  const { setUser } = useContext(Auth);
  let flag: boolean = false;
  const [regInput, setRegInput] = useState<Req>({
    email: "",
    password: "",
    repassword: "",
    name: ""
  });
  const { email, password, repassword, name } = regInput;
  // eslint-disable-next-line @typescript-eslint/no-unused-vars
  if (!email || !password || !repassword || !name) flag = true;
  const register = async () => {
    try {
      if (password !== repassword) alert("password ba re-password zorloo! shalga")
      const {data} = await sendRequest(`register/`, "POST", regInput);
      localStorage.setItem('qwert', JSON.stringify(data));
      setUser(JSON.stringify(data));
    } catch (error: any) {
      const a = error.response.data
      alert(a.error.message)
    }
  }
  return (
    <div className="flex flex-row w-screen min-h-screen">
      <div className="h-screen w-2/3 max-[1100px]:h-fit max-[1000px]:w-screen flex justify-center">
        <div className="flex flex-col w-7/12 max-[1000px]:w-11/12 mt-40 text-center">
          <h1 className="text-5xl max-[1000px]:text-4xl	font-extrabold">Create your account</h1>
          <p className="mt-5 text-gray-500	">Choose your Linktree username. You can always change it later.</p>
          <input required value={name} className="mt-20 max-[1000px]:mt-10 px-5 bg-zinc-300 h-12 rounded-md" placeholder="Username" type="text"
          onChange={(e) => {setRegInput({ ...regInput, name: e.target.value})}}
          ></input>
          <input className="rounded-md px-5 mt-4 bg-zinc-300 h-12" placeholder="Email" type="text" value={email}
          onChange={(e) => {setRegInput({ ...regInput, email: e.target.value})}}></input>
          <input value={password} className="rounded-md px-5 mt-4 bg-zinc-300 h-12" placeholder="Password" type="password"
          onChange={(e) => {setRegInput({ ...regInput, password: e.target.value})}}></input>
          <input value={repassword} className="rounded-md px-5 mt-4 bg-zinc-300 h-12" placeholder="Re-Password" type="password"
          onChange={(e) => {setRegInput({ ...regInput, repassword: e.target.value})}}></input>
          <Btn func={register} txt={"Create account"} flag={flag} cls={"mt-10 rounded-full bg-zinc-300	disabled:bg-[gray] h-12"} />
          <p className="mt-10">By clicking Create account, you agree to Linktree's Terms and Conditions , confirm you have read our Privacy Notice. You may receive offers, news and updates from us.</p>
        </div>
      </div>
      <div className="h-screen max-[1000px]:hidden w-1/3 z-20 bg-[url('data:image/png;base64,')] bg-cover"></div>
    </div>
  )
}